import React, { useEffect, useState } from "react";
import { styled } from "@mui/system";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, Typography } from '@mui/material';
import bannerImage from '../imagenes/bannerInicio.jpg';  // Asegúrate de cambiar esto a la ruta correcta de tu imagen
import { Box, FormControl, InputLabel, Select, MenuItem, Typograph } from '@mui/material';

import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';



const ContentContainer = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  width: '100%',
  '@media (max-width:600px)': {
    flexDirection: 'column',
    alignItems: 'center',
  },
});


const StyledTableCell = styled(TableCell)({
  padding: '4px',
});

const StyledTableHeaderCell = styled(TableCell)({
  padding: '8px',
  backgroundColor: '#3f51b5', // Color de fondo del encabezado
  color: '#fff', // Color del texto del encabezado
  fontSize: '1.1em', // Tamaño de la fuente del encabezado
});

const StyledTableRow = styled(TableRow)({
  '&:nth-of-type(odd)': {
    backgroundColor: '#f4f6f8', // Puedes cambiar a cualquier color que te guste.
  },
  '&:hover': {
    backgroundColor: 'lightgray',
  },
});

const StyledTableContainer = styled(TableContainer)({
  borderRadius: '10px',  // Puedes ajustar el valor a tu gusto.
  boxShadow: '0px 0px 10px 0px rgba(0,0,0,0.2)', // Sombra alrededor de la tabla.
  overflow: 'auto', // Permite el desplazamiento cuando el contenido supera la altura máxima.
  maxHeight: '400px', // Ajusta esto a la altura que desees.
});

export default function TaskList() {
  const [openDialog, setOpenDialog] = useState(false);

  const [tasks, setTasks] = useState([]);
  const [countries, setCountries] = useState([]);
  const [selectedCountry, setSelectedCountry] = useState('');
  const [provinces, setProvinces] = useState([]);
  const [selectedProvince, setSelectedProvince] = useState('');
  const [isTableVisible, setIsTableVisible] = useState(false);


  const loadTasks = async (province) => {
    const response = await fetch(`http://localhost:4000/consult/${province}`);
    const data = await response.json();
    if (data.message) {
      setOpenDialog(true);
      setIsTableVisible(false); // Ocultar la tabla si se abre el diálogo
    } else {
      setTasks(data);
      setIsTableVisible(data.length > 0);
    }
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setIsTableVisible(false); // Ocultar la tabla cuando se cierra el diálogo
  };

  useEffect(() => {
    fetch('http://localhost:4000/country')
      .then(response => response.json())
      .then(data => setCountries(data))
      .catch(error => console.error('Error:', error));
  }, []);

  useEffect(() => {
    if (selectedCountry !== '') {
      fetch(`http://localhost:4000/stateByCountry/${selectedCountry}`)
        .then(response => response.json())
        .then(data => setProvinces(data))
        .catch(error => console.error('Error:', error));
    }
  }, [selectedCountry]);

  useEffect(() => {
    if (selectedProvince) {
      loadTasks(selectedProvince);
    }
  }, [selectedProvince]);

  const handleCountryChange = (event) => {
    setSelectedCountry(event.target.value);
    setProvinces([]);
    setSelectedProvince('');
  };

  const handleProvinceChange = (event) => {
    setSelectedProvince(event.target.value);
  };

  const handleSearch = () => {
    if (selectedProvince) {
      loadTasks(selectedProvince);
    }
  };



  return (
    <>
      <ContentContainer>
        <Box sx={{
          width: { xs: '90%', sm: '35%' }, fontSize: '1.2em', margin: '20px 20px', '& p': {
            textAlign: 'justify'
          }
        }}>
          <Typography variant="h5" sx={{ color: '#000000', fontFamily: 'Helvetica Neue', margin: '20px 10px' }}>Descripción</Typography>
          <Typography variant="body1" color="#000000" fontFamily="Helvetica Neue">Nuestro sitio web es una plataforma diseñada para facilitar la georreferenciación de datos de especies. Con su interfaz fácil de usar y su funcionalidad avanzada, permite a los investigadores, administradores y usuarios administrar y analizar de manera eficiente la información sobre especies.</Typography>
          <p>Nuestro sitio web es una plataforma diseñada para facilitar la georreferenciación de datos de especies. Con su interfaz fácil de usar y su funcionalidad avanzada, permite a los investigadores, administradores y usuarios administrar y analizar de manera eficiente la información sobre especies.</p>
        </Box>
        <Box sx={{ width: { xs: '100%', sm: '45%' }, fontSize: '1.2em', margin: '0 10px' }}>



        </Box>
      </ContentContainer>

    </>
  );
}
